DROP TABLE IF EXISTS campsite;
CREATE TABLE campsite(
    id   MEDIUMINT UNSIGNED NOT NULL AUTO_INCREMENT,
    sitename VARCHAR(50),
    ken SMALLINT,
    fees VARCHAR(126),
    required_time SMALLINT,
    cancel SMALLINT,
    nature SMALLINT,
    cleanliness_restrooms SMALLINT,
    bidet ENUM("ある","なし"),
    showers SMALLINT, 
    shop ENUM("ある","なし"),
    ice_vending ENUM("ある","なし"),
    drinking ENUM("飲める","飲めない"),
    garbage ENUM("できる","できない","有料でできる"),
    parking ENUM("できる","できない"),
    space VARCHAR(50),
    check_in VARCHAR(50),
    check_out VARCHAR(50),
    comment TEXT,
    link  VARCHAR(256),
    s_image LONGBLOB,
    PRIMARY KEY(id)
    );
    


DROP TABLE IF EXISTS ken;
CREATE TABLE ken(
    id  SMALLINT,
    ken VARCHAR(10),
    PRIMARY KEY(id)
    );
    


DROP TABLE IF EXISTS required_time;
CREATE TABLE required_time(
    id  SMALLINT,
    required_time VARCHAR(10),
    PRIMARY KEY(id)
    );
    


DROP TABLE IF EXISTS cancel;
CREATE TABLE cancel(
    id  SMALLINT,
    cancel VARCHAR(10),
    PRIMARY KEY(id)
    );
    


DROP TABLE IF EXISTS nature;
CREATE TABLE nature(
    id  SMALLINT,
    nature VARCHAR(10),
    PRIMARY KEY(id)
    );
    


DROP TABLE IF EXISTS cleanliness_restrooms;
CREATE TABLE cleanliness_restrooms(
    id  SMALLINT,
    cleanliness_restrooms VARCHAR(10),
    PRIMARY KEY(id)
    );
    


DROP TABLE IF EXISTS showers;
CREATE TABLE showers(
    id  SMALLINT,
    showers VARCHAR(10),
    PRIMARY KEY(id)
    );
    
